import React from "react";
//import Header from "./Header";
class Header extends React.Component{
    constructor(props)
    {
        super(props);
        this.state = {
            qty: 0
        };
    }
    AddToCart()
    {

        return(
            this.state.qty + 1
        );
    }
    render()
    {
        return (
            <div id="hinner">
                <div id="hleft">Shopping Site Dummy</div>
                <div id="hright">Cart: </div>
            </div>
        );
    }
}
export default Header;
